(194, 'elementor_remote_info_feed_data', 'a:3:{i:0;a:5:{s:5:\"title\";s:82:\"Elementor 3.15 is Here - Check out The Taxonomy Filter, Nested Accordion, and More\";s:7:\"excerpt\";s:241:\"This release includes the first phase of the much-awaited Taxonomy Filter, the new and improved Accordion widget with nested items, enhanced styling capabilities for Carousel widgets, fun new Elementor AI Image tools, and the new Apps Page. \";s:7:\"created\";i:1691513693;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:157:\"https://elementor.com/blog/introducing-315-taxonomy-filter-nested-accordion-and-more/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:97:\"Introducing Elementor 3.14 - Gain More Design Flexibility with Nested Carousels and Loop Grid Ads\";s:7:\"excerpt\";s:239:\"This version includes a new Carousel widget, extends the Loop Grid with the ability to place static content within the Loop, a Global Styles Preview, and a multitude of highly requested styling capabilities, and new Elementor AI features. \";s:7:\"created\";i:1688394655;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:154:\"https://elementor.com/blog/introducing-314-nested-carousel-loop-grid-ads-and-more/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:87:\"Professional Hosting Tools that Boost Control and Elevate Your Online Business Presence\";s:7:\"excerpt\";s:249:\"Experience more control and workflow efficiency with powerful tools like phpMyAdmin, SFTP, and Cloning. And elevate your online brand and business with Custom Domains and Professional Mailboxes, ensuring a professional and distinct website presence.\";s:7:\"created\";i:1688054065;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:130:\"https://elementor.com/blog/new-professional-hosting-tools/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
