{s:4:\"data\";s:161:\"https://theeventscalendar.com/release-notes/events-calendar-pro/events-calendar-pro-6-2-1/?utm_source=theeventscalendar&utm_medium=referral&utm_campaign=rss-feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 05 Sep 2023 14:32:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:19:\"Events Calendar Pro\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"release notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=2542609\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:653:\"<p>Summary Maintenance Release The latest update resolves several issues including conflicts with menus and theme templates, a fatal Return value of must be of the type array, string returned, corrected auto-generated Series deletion handling, a 6.0 migration error and an Event Automator integration issue. As always, we recommend testing updates on a staging site first, but it&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/events-calendar-pro/events-calendar-pro-6-2-1/\">Events Calendar Pro 6.2.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Edwin Daniels\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3083:\"\n<p></p>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-3\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.3%\">\n<h3 class=\"wp-block-heading\" id=\"h-summary\">Summary</h3>\n\n\n\n<p class=\"release-label has-normal-font-size\">Maintenance Release</p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"release-summary__overview has-medium-font-size\">The latest update resolves several issues including conflicts with menus and theme templates, a fatal <code>Return value of must be of the type array, string returned</code>, corrected auto-generated Series deletion handling, a 6.0 migration error and an Event Automator integration issue.</p>\n\n\n\n<p>As always, we recommend <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-and-using-a-wordpress-staging-site/\" target=\"_blank\" rel=\"noreferrer noopener\">testing updates</a> on a staging site first, but it should all be smooth sailing.</p>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-css-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-6\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-fixed\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2705.png\" alt=\"✅\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Fixed</h4>\n\n\n\n<p></p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">Bugs that were squashed in this release:</p>\n\n\n\n<ul>\n<li>In scenarios where the <code>wp_posts</code> table was larger than the base provisional ID (1000000), during activation of ECP the provisional ID could get rolled back to a lower value, causing conflicts with legitimate post IDs and provisional IDs.</li>\n\n\n\n<li>Fixes a <code>Return value of TEC\\Events_Pro\\Custom_Tables\\V1\\Traits\\With_Event_RecurrenceTest::add_off_pattern_flag_to_rule() must be of the type array, string returned</code> fatal from a return type definition. This was occurring in edge cases, where recurrence data was likely invalid to begin with.</li>\n\n\n\n<li>Do not delete edited Series following deletion of last Event in it.</li>\n\n\n\n<li>After a 6.0 migration, some recurring events with date instances that were marked as <code>same-time</code> would show wrong times in classic editor. This edge case should be resolved now. The underlying data was correct but the interface support was no longer handling <code>same-time</code> dates.</li>\n\n\n\n<li>Modify output of additional fields for Event Automator to provide consistent output and prevent infinite growth of fields in Zapier.</li>\n\n\n\n<li>Removed &#8216;Series&#8217; post type from the list of available post types under &#8220;Tickets > Settings&#8221; in Event Tickets.</li>\n</ul>\n</div>\n</div>\n\n\n\n<p></p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/events-calendar-pro/events-calendar-pro-6-2-1/\">Events Calendar Pro 6.2.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"The Events Calendar 6.2.1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:161:\"https://theeventscalendar.com/release-notes/the-events-calendar/the-events-calendar-6-2-1/?utm_source=theeventscalendar&utm_medium=referral&utm_campaign=rss-feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 05 Sep 2023 14:32:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:19:\"The Events Calendar\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"release notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=2542606\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:654:\"<p>Summary Maintenance Release This version of The Events Calendar includes some accessibility improvements, fixes for 404 errors, artifacts on event tabs for multisite installations and cached widget views using incorrect filters. As always, we recommend testing updates on a staging site first, but it should all be smooth sailing! ✨ New New features included in this release:&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/the-events-calendar/the-events-calendar-6-2-1/\">The Events Calendar 6.2.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Edwin Daniels\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5934:\"\n<p></p>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-9\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.3%\">\n<h3 class=\"wp-block-heading\" id=\"h-summary\">Summary</h3>\n\n\n\n<p class=\"release-label has-normal-font-size\">Maintenance Release</p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"release-summary__overview has-medium-font-size\">This version of The Events Calendar includes some accessibility improvements, fixes for 404 errors, artifacts on event tabs for multisite installations and cached widget views using incorrect filters.</p>\n\n\n\n<p>As always, we recommend <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-and-using-a-wordpress-staging-site/\">testing updates</a> on a staging site first, but it should all be smooth sailing!</p>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-css-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-12\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-new\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2728.png\" alt=\"✨\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> New</h4>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">New features included in this release:</p>\n\n\n\n<ul>\n<li>Enhanced venue and organizer labels by updating aria labels with additional placeholders and revised translator comments, improving internationalization and accessibility.</li>\n</ul>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-css-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-15\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-fixed\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2705.png\" alt=\"✅\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Fixed</h4>\n\n\n\n<p></p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">Bugs that were squashed in this release:</p>\n\n\n\n<ul>\n<li>Correct some accessibility issues in the subscribe dropdowns. Props to @alh0319 for calling these out!</li>\n\n\n\n<li>In some cases when multiple Widgets were used on a page, the view results would return the wrong cache, displaying incorrect results. This fixes the inspection of the different view filters being used to determine whether it is cached or not.</li>\n\n\n\n<li>Fixed a bug where <code>0</code> and <code>1</code> were displayed on the <code>general</code> and <code>display</code> tabs for Network admins on multisite installations.</li>\n\n\n\n<li>WP Rewrite was being incorrectly initialized in some scenarios due to container DI, and causing some 404s. This was affecting classes that extend the <code>Tribe__Rewrite</code>.</li>\n\n\n\n<li>Resolves a plugin integration bug that happens in certain scenarios with instantiating <code>Firebase\\JWT</code> library classes. In these scenarios you would see a fatal error similar to <code>Uncaught TypeError: TEC\\Common\\Firebase\\JWT\\JWT::getKey(): Return value must be of type TEC\\Common\\Firebase\\JWT\\Key, OpenSSLAsymmetricKey returned.</code></li>\n\n\n\n<li>Broken UI on the WYSIWYG field in the Additional Content section of the admin display settings.</li>\n</ul>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-css-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-18\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-developers\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2699.png\" alt=\"⚙\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Developers</h4>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">New or updated hooks:</p>\n\n\n\n<ul>\n<li class=\"has-apercu-mono-font-family\">New Hooks: tribe_organizer_label_singular_lowercase, tribe_venue_label_singular_lowercase. </li>\n</ul>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-css-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-21\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-&#x2139;-changes\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2139.png\" alt=\"ℹ\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Changes</h4>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">Templates that have changed in this release: </p>\n\n\n\n<ul>\n<li>Changed views: <code>blocks/parts/organizer</code>, <code>blocks/parts/subscribe-list</code>, <code>modules/meta/organizer</code>, <code>modules/meta/venue</code>, <code>v2/components/subscribe-links/item</code>, <code>v2/components/subscribe-links/list</code>, <code>v2/components/subscribe-links/single-event-list</code></li>\n</ul>\n\n\n\n<p></p>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-css-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-24\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.3%\">\n<h4 class=\"wp-block-heading\" id=\"h-translations\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/1f5e3.png\" alt=\"🗣\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Translations</h4>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">Updated language files and strings:</p>\n\n\n\n<ul>\n<li>1 new strings added.</li>\n\n\n\n<li>28 updated.</li>\n\n\n\n<li>1 fuzzied.</li>\n\n\n\n<li>8 obsoleted.</li>\n</ul>\n</div>\n</div>\n\n\n\n<p></p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/the-events-calendar/the-events-calendar-6-2-1/\">The Events Calendar 6.2.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"Virtual Events 1.15.3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:152:\"https://theeventscalendar.com/release-notes/virtual-events/virtual-events-1-15-3/?utm_source=theeventscalendar&utm_medium=referral&utm_campaign=rss-feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 05 Sep 2023 14:31:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:14:\"Virtual Events\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"release notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=2542612\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:619:\"<p>Summary Maintenance Release The latest update resolves an integration with Event Automator, as well as a couple minor tweaks. As always, we recommend&#160;testing updates&#160;on a staging site first, but it should all be smooth sailing. ✅ Fixed Bugs that were squashed in this release: ⚙️ Developers New or updated hooks: ✨Tweaks New tweaks in this&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/virtual-events/virtual-events-1-15-3/\">Virtual Events 1.15.3</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Edwin Daniels\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3149:\"\n<p></p>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-27\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.3%\">\n<h3 class=\"wp-block-heading\" id=\"h-summary\">Summary</h3>\n\n\n\n<p class=\"release-label has-normal-font-size\">Maintenance Release</p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"release-summary__overview has-medium-font-size\">The latest update resolves an integration with Event Automator, as well as a couple minor tweaks.</p>\n\n\n\n<p>As always, we recommend&nbsp;<a href=\"https://theeventscalendar.com/knowledgebase/k/creating-and-using-a-wordpress-staging-site/\" target=\"_blank\" rel=\"noreferrer noopener\">testing updates</a>&nbsp;on a staging site first, but it should all be smooth sailing.</p>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-css-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-30\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-fixed\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2705.png\" alt=\"✅\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Fixed</h4>\n\n\n\n<p></p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">Bugs that were squashed in this release:</p>\n\n\n\n<ul>\n<li>Modify output of virtual event meetings details to support Microsoft Power Automate.</li>\n</ul>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-css-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-33\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-developers\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2699.png\" alt=\"⚙\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Developers</h4>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">New or updated hooks:</p>\n\n\n\n<ul>\n<li>Hooks updated: <code>tec_virtual_automator_map_event_details</code>.</li>\n\n\n\n<li>Removed filters: <code>tribe_events_virtual_video_source_virtual_url</code>, <code>tribe_events_virtual_video_source_virtual_url_disabled</code>.</li>\n</ul>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-css-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-36\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-tweaks\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2728.png\" alt=\"✨\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />Tweaks</h4>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">New tweaks in this release:</p>\n\n\n\n<ul>\n<li>Disable upgrade coding for original versions of Zoom from 2021.</li>\n</ul>\n\n\n\n<p></p>\n</div>\n</div>\n\n\n\n<p></p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/virtual-events/virtual-events-1-15-3/\">Virtual Events 1.15.3</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"Event Tickets Plus App 2.1.0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:167:\"https://theeventscalendar.com/release-notes/event-tickets-plus-app/event-tickets-plus-app-2-1-0/?utm_source=theeventscalendar&utm_medium=referral&utm_campaign=rss-feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 04 Sep 2023 13:35:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:22:\"Event Tickets Plus App\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"release notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=2542594\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:618:\"<p>Summary Maintenance Release The latest version of Event Tickets Plus App includes fixes to TLDs validations as well as several new fixes and tweaks. If you don&#8217;t already have the Event Tickets Plus app, you can find it at Google Play&#160;and the&#160;Apple App Store. ✨ New New tweaks included in this release: ✅ Fixed Bugs&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/event-tickets-plus-app/event-tickets-plus-app-2-1-0/\">Event Tickets Plus App 2.1.0</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Leopoldo Scanavino\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2910:\"\n<p></p>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-39\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.3%\">\n<h3 class=\"wp-block-heading\" id=\"h-summary\">Summary</h3>\n\n\n\n<p class=\"release-label has-normal-font-size\">Maintenance Release</p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"release-summary__overview has-medium-font-size\">The latest version of Event Tickets Plus App includes fixes to TLDs validations as well as several new fixes and tweaks.</p>\n\n\n\n<p>If you don&#8217;t already have the Event Tickets Plus app, you can find it at <a href=\"https://play.google.com/store/apps/details?id=com.theeventscalendar.eventticketsplus\" target=\"_blank\" rel=\"noreferrer noopener\">Google Play</a>&nbsp;and the&nbsp;<a href=\"https://itunes.apple.com/us/app/event-tickets-plus/id1395674797?ls=1&amp;mt=8\" target=\"_blank\" rel=\"noreferrer noopener\">Apple App Store</a>.</p>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-css-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-42\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-new\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2728.png\" alt=\"✨\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> New</h4>\n\n\n\n<p></p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">New tweaks included in this release:</p>\n\n\n\n<ul>\n<li>Added Ticket Title to Attendee Details screen</li>\n\n\n\n<li>Adjusted icon color for &#8220;Already Checked-in&#8221; attendees</li>\n</ul>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-45\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-fixed\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2705.png\" alt=\"✅\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Fixed</h4>\n\n\n\n<p></p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">Bugs that were squashed in this release:</p>\n\n\n\n<ul>\n<li>New and future TLDs (.barcelona, .realestate, etc.) are now validated correctly in site setup and ticket QR scans.</li>\n\n\n\n<li>Event attendees lists now show attendees with completed orders only, so that attendees who e.g. have not finished paying for their order cannot be accidentally checked in.</li>\n\n\n\n<li>More reliable loading of events without needing to refresh site settings.</li>\n</ul>\n</div>\n</div>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/event-tickets-plus-app/event-tickets-plus-app-2-1-0/\">Event Tickets Plus App 2.1.0</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"How to Effectively Communicate with Your Event Team\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:175:\"https://theeventscalendar.com/blog/event-management/how-to-effectively-communicate-with-your-event-team/?utm_source=theeventscalendar&utm_medium=referral&utm_campaign=rss-feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 24 Aug 2023 13:00:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:16:\"Event Management\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:4:\"blog\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=2542510\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:659:\"<p>Planning an event is often a group effort. You may be delegating tasks to your team while also collaborating with vendors, venues, co-hosts, and other outside parties.&#160; The key to managing it all: Communication. Effectively communicating with your event team will ensure that your event runs smoothly. It will also make life easier for you&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/blog/event-management/how-to-effectively-communicate-with-your-event-team/\">How to Effectively Communicate with Your Event Team</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Lauren\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:6951:\"\n<p>Planning an event is often a group effort. You may be delegating tasks to your team while also collaborating with vendors, venues, co-hosts, and other outside parties.&nbsp;</p>\n\n\n\n<p>The key to managing it all: Communication.</p>\n\n\n\n<p>Effectively communicating with your event team will ensure that your event runs smoothly. It will also make life easier for you <em>and </em>for each member of the team. By setting clear expectations for everyone, you’ll head off confusion and keep the team motivated and happy.</p>\n\n\n\n<p>Before you start doling out tasks, read up on these four tips for effective event communication.</p>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"h-1-set-clear-expectations\">1. Set clear expectations.</h2>\n\n\n\n<p>First things first: Have you set <a href=\"https://theeventscalendar.com/blog/event-management/defining-event-goals-and-objectives/\" target=\"_blank\" rel=\"noreferrer noopener\">clear goa</a>ls and objectives for your event? If not, don’t skip this step. You need to be able to articulate what you hope to accomplish with your event, whether your aim is to build community or sell a product. Communicate these goals and objectives to the rest of your team so they can get on board with your game plan.</p>\n\n\n\n<p>From there, start assigning roles and responsibilities to team members. One way to break down duties is to think about what needs to happen before, during, and after the event:</p>\n\n\n\n<ul>\n<li><em>Before the event. </em>Who will update the events and ticket pages on your website? Will you send an email invite to attendees? Do you need someone to coordinate paid or word-of-mouth marketing efforts to promote your event?</li>\n\n\n\n<li><em>During the event. </em>Do you need someone to handle registration and sign-in? If money is changing hands, who will be in charge of the cash register or payment device? Logistics vary across events, so spend time thinking about all the duties you need to assign to ensure a smooth event for your team and your guests.</li>\n\n\n\n<li><em>After the event. </em>Who will be handling immediate event clean-up? It could be you, a team member, or the venue. Assign a team member to send a post-event survey to attendees, follow through on unpaid invoices, and schedule time for your team to come together and review what went well and what you can improve for next time.</li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"h-2-use-the-right-communication-tools\">2. Use the right communication tools.</h2>\n\n\n\n<p>You’ll likely rely on multiple communication tools and channels to communicate with your event team and spread the word about your event. Here are some tools to keep in mind:</p>\n\n\n\n<ul>\n<li><em>Email. </em>Keep your emails organized as you correspond with your team, your venue, and your vendors. Consider creating a subfolder or label so that you can easily pull up all the important emails related to your event.</li>\n\n\n\n<li><em>Project management software. </em>Whether your team uses Asana, Monday.com, Airtable, or any of the other myriad project management products on the market, your team’s system will serve as a hub for assigning tasks, monitoring deadlines, and staying accountable.</li>\n\n\n\n<li><em>WordPress plugins. </em>When it’s time to spread the word about your events, take advantage of tools for your WordPress site. Our free flagship plugins—<a href=\"https://theeventscalendar.com/products/wordpress-events-calendar/\" target=\"_blank\" rel=\"noreferrer noopener\">The Events Calendar</a> and <a href=\"https://theeventscalendar.com/products/wordpress-event-tickets/\" target=\"_blank\" rel=\"noreferrer noopener\">Event Tickets</a>—let you promote events on your website, sell tickets, and collect RSVPs. Our premium <a href=\"https://theeventscalendar.com/products/promoter/\" target=\"_blank\" rel=\"noreferrer noopener\">Promoter</a> plugin makes it easy to send automated emails to your guests. If you’re planning a virtual or hybrid event, use <a href=\"https://theeventscalendar.com/products/wordpress-virtual-events/\" target=\"_blank\" rel=\"noreferrer noopener\">Virtual Events</a> to embed live streams or video conferencing within your event.</li>\n\n\n\n<li><em>Automation tools. </em>If you use The Events Calendar plugins to manage your events, you can also use our premium<a href=\"https://theeventscalendar.com/products/event-automator/\" target=\"_blank\" rel=\"noreferrer noopener\"> Events Automator</a> plugin to connect your calendar and tickets to thousands of the most popular apps via Zapier. Make it easy for your team to handle every stage of the event planning process by connecting and automating all of your tools in one place.</li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"h-3-encourage-open-and-honest-communication\">3. Encourage open and honest communication.</h2>\n\n\n\n<p>To foster a culture of openness and transparency with your team, lead by example. Encourage each member of your team to share feedback and ideas—and be open to their ideas and suggestions. Show that you value your input by trying out their ideas and setting your own ego aside.&nbsp;</p>\n\n\n\n<p>Consider scheduling regular check-ins with your team to talk through any questions, concerns, or ideas in a non-judgmental environment. And when concerns come up, address them promptly.</p>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"h-4-manage-conflicts-like-a-pro\">4. Manage conflicts like a pro.</h2>\n\n\n\n<p>This goes hand-in-hand with open and honest communication. Try to keep your emotions out of conflicts—it can help to seek out mediation or outside help if a situation escalates. Give your team members, vendors, and other collaborators the benefit of the doubt, and try to handle difficult situations with grace. Not only will this help you avoid an awkward situation on the day of your event, but it will help you preserve important relationships with your event team.</p>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"h-communication-a-key-to-event-success\">Communication: A key to event success</h2>\n\n\n\n<p>The way you communicate—or don’t communicate—with your event team can make or break the success of your event. Start the event-planning process with specific goals and a plan that you clearly communicate with each member of the team. When everyone is on board with your goals, they’ll be engaged and aware of how their individual contributions matter to the success of the event.</p>\n\n\n\n<p>Looking for ways to simplify event management for yourself and your team? <a href=\"https://demo.theeventscalendar.com/\" target=\"_blank\" rel=\"noreferrer noopener\">Check out a demo of all of The Events Calendar plugins</a> to see our free and premium tools in action.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/blog/event-management/how-to-effectively-communicate-with-your-event-team/\">How to Effectively Communicate with Your Event Team</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"Community Events 4.10.12\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:157:\"https://theeventscalendar.com/release-notes/community-events/community-events-4-10-12/?utm_source=theeventscalendar&utm_medium=referral&utm_campaign=rss-feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 16 Aug 2023 17:47:58 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:16:\"Community Events\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"release notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=2542519\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:619:\"<p>Summary Maintenance Release The latest Community Events version includes styling improvements when using the Twenty Twenty-One theme as well as some fixes to recurring events deletion. As always, we recommend testing updates on a staging site first, but it should all be smooth sailing. ✨ New New tweaks and enhancements in this release: ✅ Fixed&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/community-events/community-events-4-10-12/\">Community Events 4.10.12</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Leopoldo Scanavino\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3146:\"\n<p></p>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-48\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.3%\">\n<h3 class=\"wp-block-heading\" id=\"h-summary\">Summary</h3>\n\n\n\n<p class=\"release-label has-normal-font-size\">Maintenance Release</p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"release-summary__overview has-medium-font-size\">The latest Community Events version includes styling improvements when using the Twenty Twenty-One theme as well as some fixes to recurring events deletion.</p>\n\n\n\n<p>As always, we recommend <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-and-using-a-wordpress-staging-site/\" target=\"_blank\" rel=\"noreferrer noopener\">testing updates</a> on a staging site first, but it should all be smooth sailing.</p>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-51\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-new\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2728.png\" alt=\"✨\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> New</h4>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">New tweaks and enhancements in this release:</p>\n\n\n\n<ul>\n<li>Improved styling for checkboxes when using Twenty Twenty-One theme.</li>\n</ul>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-54\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-fixed\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2705.png\" alt=\"✅\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Fixed</h4>\n\n\n\n<p></p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">Bugs that were squashed in this release:</p>\n\n\n\n<ul>\n<li>When deleting recurring events, the page will now automatically refresh to ensure the proper removal of all instances. </li>\n</ul>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-57\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.3%\">\n<h4 class=\"wp-block-heading\" id=\"h-translations\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/1f5e3.png\" alt=\"🗣\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Translations</h4>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">Updated language files and strings:</p>\n\n\n\n<ul>\n<li>0 new strings added</li>\n\n\n\n<li>55 updated</li>\n\n\n\n<li>0 fuzzied</li>\n\n\n\n<li>0 obsoleted</li>\n</ul>\n</div>\n</div>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/community-events/community-events-4-10-12/\">Community Events 4.10.12</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"Event Tickets Plus 5.7.4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:159:\"https://theeventscalendar.com/release-notes/event-tickets-plus/event-tickets-plus-5-7-4/?utm_source=theeventscalendar&utm_medium=referral&utm_campaign=rss-feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 16 Aug 2023 17:47:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:18:\"Event Tickets Plus\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"release notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=2542517\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:614:\"<p>Summary Maintenance Release The latest version of Event Tickets Plus includes several performance improvements and new fixes and tweaks. As always, we recommend testing updates on a staging site first, but it should all be smooth sailing. ✨ New New tweaks and enhancements in this release: ✅ Fixed Bugs that were squashed in this release:&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/event-tickets-plus/event-tickets-plus-5-7-4/\">Event Tickets Plus 5.7.4</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Leopoldo Scanavino\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3696:\"\n<p></p>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-60\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.3%\">\n<h3 class=\"wp-block-heading\" id=\"h-summary\">Summary</h3>\n\n\n\n<p class=\"release-label has-normal-font-size\">Maintenance Release</p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"release-summary__overview has-medium-font-size\">The latest version of Event Tickets Plus includes several performance improvements and new fixes and tweaks.</p>\n\n\n\n<p>As always, we recommend <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-and-using-a-wordpress-staging-site/\" target=\"_blank\" rel=\"noreferrer noopener\">testing updates</a> on a staging site first, but it should all be smooth sailing.</p>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-63\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-new\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2728.png\" alt=\"✨\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> New</h4>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">New tweaks and enhancements in this release:</p>\n\n\n\n<ul>\n<li>Cache Tickets objects for performance improvements.</li>\n\n\n\n<li>The Attendee Registration page will now display properly when using Divi with dynamic CSS enabled.</li>\n</ul>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-66\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-fixed\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2705.png\" alt=\"✅\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Fixed</h4>\n\n\n\n<p></p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">Bugs that were squashed in this release:</p>\n\n\n\n<ul>\n<li>Fixed displaying WooCommerce Ticket prices which include tax or vat.</li>\n\n\n\n<li>Ensure the Attendees page displays correctly when accessed through the Events Manager.</li>\n\n\n\n<li>Avoided duplication of manually created attendees for Easy Digital Downloads.</li>\n\n\n\n<li>Fixed fatal errors that were occurring when using Elementor.</li>\n\n\n\n<li>Resolved an issue where deleting a WooCommerce ticket would result in an error.</li>\n\n\n\n<li>Fixed showing saved ARF values for checkboxes as not selected while editing an attendee. </li>\n\n\n\n<li>Allowed filtering of Ticket Meta cookie name to fix conflict with Pantheon hosting.</li>\n</ul>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-69\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.3%\">\n<h4 class=\"wp-block-heading\" id=\"h-translations\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/1f5e3.png\" alt=\"🗣\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Translations</h4>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">Updated language files and strings:</p>\n\n\n\n<ul>\n<li>0 new strings added</li>\n\n\n\n<li>25 updated</li>\n\n\n\n<li>0 fuzzied</li>\n\n\n\n<li>0 obsoleted</li>\n</ul>\n</div>\n</div>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/event-tickets-plus/event-tickets-plus-5-7-4/\">Event Tickets Plus 5.7.4</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:19:\"Event Tickets 5.6.4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:149:\"https://theeventscalendar.com/release-notes/event-tickets/event-tickets-5-6-4/?utm_source=theeventscalendar&utm_medium=referral&utm_campaign=rss-feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 16 Aug 2023 17:47:53 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Event Tickets\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"release notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=2542515\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:606:\"<p>Summary Maintenance Release The latest version of Event Tickets includes several performance improvements and additional fixes and tweaks. As always, we recommend testing updates on a staging site first, but it should all be smooth sailing. ✨ New New tweaks and enhancements in this release: ✅ Fixed Bugs that were squashed in this release: 🗣&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/event-tickets/event-tickets-5-6-4/\">Event Tickets 5.6.4</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Leopoldo Scanavino\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4060:\"\n<p></p>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-72\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.3%\">\n<h3 class=\"wp-block-heading\" id=\"h-summary\">Summary</h3>\n\n\n\n<p class=\"release-label has-normal-font-size\">Maintenance Release</p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"release-summary__overview has-medium-font-size\">The latest version of Event Tickets includes several performance improvements and additional fixes and tweaks.</p>\n\n\n\n<p>As always, we recommend <a href=\"https://theeventscalendar.com/knowledgebase/k/creating-and-using-a-wordpress-staging-site/\" target=\"_blank\" rel=\"noreferrer noopener\">testing updates</a> on a staging site first, but it should all be smooth sailing.</p>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-75\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-new\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2728.png\" alt=\"✨\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> New</h4>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">New tweaks and enhancements in this release:</p>\n\n\n\n<ul>\n<li>New Cache Tickets objects for performance improvements.</li>\n\n\n\n<li>The Attendee Registration page will now display properly when using Divi with dynamic CSS enabled.</li>\n\n\n\n<li>Included Event/Post title alongside Ticket name on PayPal order notification emails.</li>\n\n\n\n<li>Removed several PHP 8.1 deprecation warnings.</li>\n\n\n\n<li>Added a notice in the Tickets Commerce Paypal settings for non-https sites.</li>\n\n\n\n<li>Capitalize payment provider names in Tickets Emails.</li>\n</ul>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-78\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-fixed\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2705.png\" alt=\"✅\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Fixed</h4>\n\n\n\n<p></p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">Bugs that were squashed in this release:</p>\n\n\n\n<ul>\n<li>Fixed translation issues with translating month names in other languages while displaying ticket available messages.</li>\n\n\n\n<li>Ensure the Attendees page is displayed correctly when accessed through the Events Manager.</li>\n\n\n\n<li>Included Commerce tickets in cached results; correctly fetched posts without tickets.</li>\n\n\n\n<li>Prevent creating tickets in Classic Editor for recurring events when using custom tables.</li>\n\n\n\n<li>Prevent creating tickets in Block Editor for recurring events when using custom tables.</li>\n\n\n\n<li>Fixed footer links in Tickets Emails template using the wrong color.</li>\n\n\n\n<li>Removed double-escaped characters in Tickets Emails sender&#8217;s name.</li>\n</ul>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-81\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.3%\">\n<h4 class=\"wp-block-heading\" id=\"h-translations\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/1f5e3.png\" alt=\"🗣\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Translations</h4>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">Updated language files and strings:</p>\n\n\n\n<ul>\n<li>2 new strings added</li>\n\n\n\n<li>89 updated</li>\n\n\n\n<li>0 fuzzied</li>\n\n\n\n<li>0 obsoleted</li>\n</ul>\n</div>\n</div>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/event-tickets/event-tickets-5-6-4/\">Event Tickets 5.6.4</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"The Events Calendar 6.2.0.1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:163:\"https://theeventscalendar.com/release-notes/the-events-calendar/the-events-calendar-6-2-0-1/?utm_source=theeventscalendar&utm_medium=referral&utm_campaign=rss-feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 16 Aug 2023 16:29:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:19:\"The Events Calendar\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"release notes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=2542521\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:589:\"<p>Summary Maintenance Release This version of The Events Calendar includes&#160;a fix for the Uncaught TypeError introduced with TEC 6.2.0. As always, we recommend&#160;testing updates&#160;on a staging site first, but it should all be smooth sailing! ✅ Fixed Bugs that were squashed in this release 🗣 Translations</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/the-events-calendar/the-events-calendar-6-2-0-1/\">The Events Calendar 6.2.0.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Emily Negroni\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2312:\"\n<p></p>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-84\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.3%\">\n<h3 class=\"wp-block-heading\" id=\"h-summary\">Summary</h3>\n\n\n\n<p class=\"release-label has-normal-font-size\">Maintenance Release</p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"release-summary__overview has-medium-font-size\">This version of The Events Calendar includes&nbsp;a fix for the Uncaught TypeError introduced with TEC 6.2.0.</p>\n\n\n\n<p>As always, we recommend&nbsp;<a href=\"https://theeventscalendar.com/knowledgebase/k/creating-and-using-a-wordpress-staging-site/\">testing updates</a>&nbsp;on a staging site first, but it should all be smooth sailing!</p>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-css-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-87\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.33%\">\n<h4 class=\"wp-block-heading\" id=\"h-fixed\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2705.png\" alt=\"✅\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Fixed</h4>\n\n\n\n<p></p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\">Bugs that were squashed in this release</p>\n\n\n\n<ul>\n<li>This fix is to ensure we pass the correct number of params to <code>maybe_get_new_order_from_blocks</code></li>\n</ul>\n</div>\n</div>\n\n\n\n<hr class=\"wp-block-separator has-css-opacity\"/>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-90\">\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:33.3%\">\n<h4 class=\"wp-block-heading\" id=\"h-translations\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/1f5e3.png\" alt=\"🗣\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Translations</h4>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow\" style=\"flex-basis:66.66%\">\n<p class=\"has-medium-font-size\"></p>\n\n\n\n<ul>\n<li>No language/translation changes.</li>\n</ul>\n</div>\n</div>\n\n\n\n<p></p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/release-notes/the-events-calendar/the-events-calendar-6-2-0-1/\">The Events Calendar 6.2.0.1</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"Introducing New Features for Events Calendar Pro\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:160:\"https://theeventscalendar.com/blog/news/introducing-new-features-for-events-calendar-pro/?utm_source=theeventscalendar&utm_medium=referral&utm_campaign=rss-feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 15 Aug 2023 14:26:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:10:\"What\'s New\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:4:\"blog\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://theeventscalendar.com/?p=2542386\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:653:\"<p>We&#8217;re so excited to announce that we&#8217;ve just released new features for our Events Calendar Pro users. These feature ideas come directly from our users, and we&#8217;re delighted to be able to make those requests a reality. Thanks to your suggestions and upvotes, we&#8217;ve expanded the functionality for venues and organizers to give you even&#8230;</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/blog/news/introducing-new-features-for-events-calendar-pro/\">Introducing New Features for Events Calendar Pro</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Jaime\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4378:\"\n<p>We&#8217;re so excited to announce that we&#8217;ve just released new features for our <a href=\"https://theeventscalendar.com/products/wordpress-events-calendar/\" target=\"_blank\" rel=\"noreferrer noopener\">Events Calendar Pro</a> users. These feature ideas come directly from our users, and we&#8217;re delighted to be able to make those requests a reality. Thanks to your suggestions and upvotes, we&#8217;ve expanded the functionality for venues and organizers to give you even more flexibility and options.</p>\n\n\n\n<p>Before we get into the nitty-gritty of the features, we want our customers to know that we are always listening to your requests. We may not always be able to implement things immediately, but we always look for ways to make our customers happy, so <a href=\"https://app.loopedin.io/the-events-calendar-suite-roadmap#/ideas\" target=\"_blank\" rel=\"noreferrer noopener\">keep those suggestions coming</a>!</p>\n\n\n\n<p>So without further ado, here&#8217;s a quick breakdown of the awesome new features!</p>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"h-multiple-venue-support\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/1f3df.png\" alt=\"🏟\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Multiple venue support</h2>\n\n\n\n<p>A highly requested feature from our current customers, this feature allows all Events Calendar Pro users to add multiple venues to a single event. This feature is great when you&#8217;d like to host a single event at various locations. It works well for bar crawls, restaurant chains broadcasting sports events, festivals, workshops, and more! This feature also includes <a href=\"https://theeventscalendar.com/products/wordpress-calendar-filter-bar/\" target=\"_blank\" rel=\"noreferrer noopener\">Filter Bar</a> support so an event will appear in filtered results for any of its assigned venues.</p>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"h-featured-images-for-venue-and-organizer-pages\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/1f303.png\" alt=\"🌃\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Featured images for venue and organizer pages</h2>\n\n\n\n<p>Just like it sounds, this feature now allows you to add a featured image for all venue and organizer pages, mirroring the appearance of single event pages. Adding a featured image to these pages can improve both the way the page looks, as well as the SEO.</p>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"h-categories-for-venue-and-organizer-pages\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/1f3cb-fe0f-200d-2640-fe0f.png\" alt=\"🏋️‍♀️\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />Categories for venue and organizer pages</h2>\n\n\n\n<p>With this new feature, you can now add categories to venues and organizers. These categories will make venue and organizer pages more discoverable and easier to search through. The new venues category archive displays upcoming events at venues with a given category, and the new organizer category archives display upcoming events with organizers of a given category. Want to show a page of upcoming events at parks? Now you can!</p>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"h-hide-organizer-email-and-phone\"><img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/1f4f1.png\" alt=\"📱\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />Hide organizer email and phone</h2>\n\n\n\n<p>New settings allow you to hide organizer emails and phone numbers from event pages, organizer pages, or both. This improves security and privacy on your site. You can find the new options under Events &gt; Settings &gt; Display &gt; Organizers.</p>\n\n\n\n<h2 class=\"wp-block-heading\">We&#8217;re here for you!</h2>\n\n\n\n<p>There&#8217;s nothing more important to us than our customers. We value customer feedback so much and are always looking for opportunities to increase customer happiness. You can always <a href=\"https://app.loopedin.io/the-events-calendar-suite-roadmap#/roadmap\" target=\"_blank\" rel=\"noreferrer noopener\">add new feature requests here</a>, upvote existing ideas, and check out our updated roadmap.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://theeventscalendar.com/blog/news/introducing-new-features-for-events-calendar-pro/\">Introducing New Features for Events Calendar Pro</a> appeared first on <a rel=\"nofollow\" href=\"https://theeventscalendar.com\">The Events Calendar</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:35:\"https://theeventscalendar.com/feed/\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:44:\"http://purl.org/rss/1.0/modules/syndication/\";a:2:{s:12:\"updatePeriod\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"\n	hourly	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:15:\"updateFrequency\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"\n	1	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:48:\"WpOrg\\Requests\\Utility\\CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:13:{s:4:\"date\";s:29:\"Wed, 06 Sep 2023 10:13:01 GMT\";s:12:\"content-type\";s:34:\"application/rss+xml; charset=UTF-8\";s:6:\"cf-ray\";s:20:\"8025efd69e0b545a-JIB\";s:15:\"cf-cache-status\";s:6:\"BYPASS\";s:4:\"etag\";s:34:\"\"28958941d2e74f2f80bfb273bb585098\"\";s:13:\"last-modified\";s:29:\"Tue, 05 Sep 2023 18:10:12 GMT\";s:4:\"link\";s:117:\"<https://theeventscalendar.com/wp-json/>; rel=\"https://api.w.org/\", <https://theeventscalendar.com/>; rel=\"canonical\"\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:10:\"cf-apo-via\";s:11:\"origin,feed\";s:13:\"cf-edge-cache\";s:24:\"cache,platform=wordpress\";s:9:\"x-nocache\";s:1:\"1\";s:6:\"server\";s:10:\"cloudflare\";s:7:\"alt-svc\";s:19:\"h3=\":443\"; ma=86400\";}}s:5:\"build\";s:14:\"20211220193300\";}', 'no');
