t spends the rest of the day relaxing in the hotel. You may book some watersports like deep sea fishing, diving lessons, skydiving, or jet skiing.</li>\n 	<li class=\"l-info-pack-plac\"><i class=\"fa fa-clock-o\" aria-hidden=\"true\"></i>\n<h4>Day 6 SPA TREATMENTS &amp; DINNER CRUISE</h4>\nAfter breakfast spends the rest of the day relaxing in the hotel. You may book some watersports like deep sea fishing, diving lessons, skydiving, or jet skiing.</li>\n 	<li class=\"l-info-pack-plac\"><i class=\"fa fa-clock-o\" aria-hidden=\"true\"></i>\n<h4>Day 7 RELAXATION</h4>\nAfter breakfast enjoy the hotel facilities till the time to check out</li>\n</ul>', '7 Days Mombasa Package', '', 'inherit', 'closed', 'closed', '', '30-autosave-v1', '', '', '2023-09-06 12:11:08', '2023-09-06 12:11:08', '', 30, 'http://localhost/savannah/?p=37', 0, 'revision', '', 0),
(38, 1, '2023-09-06 12:46:07', '2023-09-06 12:46:07', '<div class=\"tour_head1\">\r\n\r\nHome to The Big Five, Mighty Masai Warriors And The Eight Wonder Of The World. This destination is a must see for every traveler. Prepare to be in awe by the stunning views of the African plains, come face to face with the king of the jungle and learn more about the Maasai Mara. Part of the fun of going on safari is planning your safari. We have been there and we know how it feels. As avid travelers we can imagine you have a ton of questions. Very few places on earth are as unspoilt, adventurous and authentic as the Maasai Mara eco-system. Allow us to plan the best 3-Day safari adventure just for you.\r\n\r\n</div>\r\n<div id=\"photos\" class=\"tour_head1 hotel-book-room\">\r\n<h3>Detailed Day Wise Itinerary</h3>\r\n<ul>\r\n 	<li class=\"l-info-pack-plac\"><i class=\"fa fa-clock-o\" aria-hidden=\"true\"></i>\r\n<h4>Day 1: Departure From Nairobi To Maasai Mara</h4>\r\nThe start of the safari will be from the Bonfire Adventures Town Office (Yala Towers) at 0630hrs. The journey begins with a meet and greet which shall be followed by a short briefing by our safari driver. Get the chance to soak in the beautiful views as we descend to the Great Rift Valley all the way to the Maasai Mara. The drive It will take approximately 5.5hours. There will be a quick stop over at the Great Rift Valley viewpoint, to enjoy the amazing views of the largest Valley in the world, said to be visible from outer space. Arrival at Maasai Mara will be around lunch hour giving you the chance to check into your camp or lodge, then enjoy a delicious meal. At 0330hrs, it\'s time to head out on your afternoon game drive. Get the chance to drive to the waterholes to see what animals have come down to enjoy a drink. Expect to find the large herbivores elephants, rhinos and buffalos cooling down by immersing themselves in water and having a good old mud bath. Hyenas and wild dogs still move around during the day and as the heat of the day continues to set in expect to spot beautiful lions in a pride resting under a shady spot, or cheetahs as well as leopards. In the evening you will drive back to your camp or lodge for dinner and an overnight stay.</li>\r\n 	<li class=\"l-info-pack-plac\"><i class=\"fa fa-clock-o\" aria-hidden=\"true\"></i>\r\n<h4>Day 2: ENJOY A FULL DAY IN MAASAI MARA</h4>\r\nThis is one of the best days for safari lovers. Right after breakfast, sit back, relax and discover the wild beauty of the Kenya\'s Maasai Mara. Boasting one of the finest collections of wild animals, our expert tour guides are simply the best when it comes to uncovering the wonders of this safari destination. Get to come face to face with the Big Five, spot a great species of mammals, birds and some very spectacular looking creatures that you may not have heard of. For lunch, you will get to enjoy a deliciously packed picnic under the shade of an Acacia tree, or overlooking the snorting hippos which wallow in the Mara River. Return to your camp or lodge in the evening, relax, enjoy the amenities and dinner.</li>\r\n 	<li class=\"l-info-pack-plac\"><i class=\"fa fa-clock-o\" aria-hidden=\"true\"></i>\r\n<h4>Day 3: DEPARTURE FROM MAASAI MARA, GAME DRIVE AND RETURN TO NAIROBI</h4>\r\nThe last and final day of your Masai Mara Safari begins at the break of dawn with breakfast. If you would like, you can embark on another game drive in the early morning. Wildlife abundance in the reserve is high at this early hours of the day. You can take advantage over this game drive to look out for wild animals that you may not have spotted during your last two days of your safari. After the departure from your camp or lodge, we will depart from Maasai Mara driving via Narok Town (Maasai Market) with a short stop-over for any possible shopping. Continue to Nairobi arriving from around 02:00pm. Drop off is at the convenient point of your choice.</li>\r\n</ul>\r\n</div>', '3 Days Masai Mara Packages 4.5', '', 'publish', 'open', 'closed', '', '3-days-masai-mara-packages-4-5', '', '', '2023-09-06 12:46:07', '2023-09-06 12:46:07', '', 0, 'http://localhost/savannah/?post_type=tribe_events&#038;p=38', 0, 'tribe_events', '', 0),
